import { Component } from 'react';
import axios from 'axios';

class EquipmentList extends Component {
    constructor(props) {
        super(props);
        this.state = { 
            equipmentList:[]
        }
    }
    componentDidMount(){
        this.getEquipmentList();
    }
    getEquipmentList=()=>{
        axios.get('/api/db.json').then((res) => {
            const data = res.data.equipments;
           this.setState({
            equipmentList:data
           })
           this.forceUpdate();
        }).catch(() => {
            console.log('error')
        })
    }
    render() { 
        return ( <div>
            <ul>
                {this.state.equipmentList.map(equipment=>{
                    return <li key={equipment.id}>{equipment.model}</li>
                })}
            </ul>
        </div> );
    }
}

export default EquipmentList;
